@goatsneakers: Travis Scott and Fragment Design rework the AJ1 Retro High, outfitting the iconic silhouette in white tumbled leather with Military Blue hits on the toe box, collar flap and heel overlay. Scott's signature inverted Swoosh appears in contrasting black leather.

Additional design details include a hidden pouch built into the black nylon collar, fragment's lightning bolt logo on the right shoe and La Flame’s Cactus Jack smiley face on the left. Pre-yellowed sidewalls on the rubber cupsole complete the release.

Available on the app and GOAT.com
